    function hashToField(bytes memory value) internal pure returns (uint256) {
        return uint256(keccak256(abi.encodePacked(value))) >> 8;
    }
}","keccak256":"0xdf7abea628f202e09d500fd6e1d27c6e900a088f2a79ae4870463d13fc888d65","license":"MIT"},"contracts/interfaces/IWorldID.sol":{"content":"//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IWorldID {
    /// @notice Reverts if the zero-knowledge proof is invalid.
    /// @param root The of the Merkle tree
    /// @param groupId The id of the Semaphore group
    /// @param signalHash A keccak256 hash of the Semaphore signal
    /// @param nullifierHash The nullifier hash
    /// @param externalNullifierHash A keccak256 hash of the external nullifier
    /// @param proof The zero-knowledge proof
    /// @dev  Note that a double-signaling check is not included here, and should be carried by the caller.
    function verifyProof(
        uint256 root,
        uint256 groupId,
        uint256 signalHash,
        uint256 nullifierHash,
        uint256 externalNullifierHash,
        uint256[8] calldata proof
    ) external view;
}","keccak256":"0x0e48b38618c0adf1de814097db7b6e99b549926948ea73214dda0539780f5fb0","license":"MIT"}},"version":1}

